import React from "react";
import { useLocation, useNavigate } from "react-router-dom";
import jsPDF from "jspdf";
import html2canvas from "html2canvas";

export default function CustomsPreview() {
  const location = useLocation();
  const navigate = useNavigate();
  const { selectedData = [], company = "", doc_number = "" } = location.state || {};

  const today = new Date();
  const dateString = `${String(today.getFullYear()).slice(2)}${String(today.getMonth() + 1).padStart(2, "0")}${String(today.getDate()).padStart(2, "0")}`;

  const downloadPDF = () => {
    const doc = new jsPDF("p", "pt", "a4");
    const input = document.getElementById("invoice-content");

    const companySafe = company ? company.replace(/[^Í∞Ä-Ìû£a-zA-Z0-9\s]/g, "") : "ÏóÖÏ≤¥Î™ÖÏóÜÏùå";
    const filename = `[Í¥ÄÏÑ∏Î≤ïÏù∏ÌïúÏòÅ] ${companySafe} ÌÜµÍ¥ÄÏàòÏàòÎ£å Í≤¨Ï†ÅÏÑú_${dateString}.pdf`;

    html2canvas(input, { scale: 2 }).then((canvas) => {
      const imgData = canvas.toDataURL("image/png");
      const pdfWidth = doc.internal.pageSize.getWidth() - 40;
      const imgProps = doc.getImageProperties(imgData);
      const pdfHeight = (imgProps.height * pdfWidth) / imgProps.width;
      doc.addImage(imgData, "PNG", 20, 20, pdfWidth, pdfHeight);
      doc.save(filename);
    });
  };

  const labelMap = {
    feeRate: "ÏàòÏàòÎ£å ÏöîÏú®",
    minFee: "MIN",
    maxFee: "MAX",
    correctionFee: "Ïã†Í≥†Ï†ïÏ†ï",
    ftaApplication: "FTA ÌòëÏ†ïÏã†Ï≤≠",
    requirementApplication: "ÏöîÍ±¥Ïã†Ï≤≠",
    exportFeeRate: "ÏàòÏàòÎ£å ÏöîÏú®",
    exportMinFee: "MIN",
    exportMaxFee: "MAX",
    exportCorrectionFee: "Ïã†Í≥†Ï†ïÏ†ï",
    exportFtaCertificateAuthorized: "FTA C/O Î∞úÍ∏â (Ïù∏Ï¶ùÏàòÏ∂úÏûê)",
    exportFtaCertificateUnauth: "FTA C/O Î∞úÍ∏â (ÎπÑÏù∏Ï¶ùÏàòÏ∂úÏûê)",
  };

  const importItems = selectedData.filter((item) => !item.label.startsWith("export"));
  const exportItems = selectedData.filter((item) => item.label.startsWith("export"));

  const renderTable = (title, items) => (
    <>
      <h2 style={{ textAlign: "center", margin: "40px 0 20px", fontSize: 20 }}>{title}</h2>
      <table style={{ width: "100%", borderCollapse: "collapse", marginBottom: 20 }}>
        <thead>
          <tr style={{ backgroundColor: "#3f72af", color: "#fff" }}>
            <th style={{ padding: 12, width: "30%", textAlign: "left" }}>Ìï≠Î™©</th>
            <th style={{ padding: 12, width: "30%", textAlign: "left" }}>Í∏àÏï°</th>
            <th style={{ padding: 12, width: "40%", textAlign: "left" }}>ÎπÑÍ≥†</th>
          </tr>
        </thead>
        <tbody>
          {items.map(({ label, value, note }) => (
            <tr key={label} style={{ borderBottom: "1px solid #ddd", backgroundColor: "#fff" }}>
              <td style={{ padding: 10 }}>{labelMap[label] || label}</td>
              <td style={{ padding: 10 }}>
                {label.includes("Rate") ? `${value}%` : `${Number(value).toLocaleString()} Ïõê`}
              </td>
              <td style={{ padding: 10 }}>{note || "-"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );

  return (
    <>
      <div
        id="invoice-content"
        style={{
          fontFamily: "'Pretendard', sans-serif",
          backgroundColor: "#fff",
          color: "#222",
          padding: 60,
          maxWidth: 800,
          margin: "60px auto",
          border: "1px solid #ddd",
        }}
      >
        <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: 40 }}>
          <div>
            <h1 style={{ fontSize: 32, fontWeight: 700 }}>ÌÜµÍ¥Ä ÏàòÏàòÎ£å Í≤¨Ï†ÅÏÑú</h1>
            <p style={{ fontSize: 14, color: "#666" }}>
              No. HY25{doc_number || "XXX"} / {today.toLocaleDateString("ko-KR")}
            </p>
          </div>
          <div style={{ width: 160 }}>
            <img
              src={`${process.env.PUBLIC_URL}/images/HYLOGO_NAVY.png`}
              alt="ÌïúÏòÅ Î°úÍ≥†"
              style={{ width: "100%", objectFit: "contain" }}
            />
          </div>
        </div>

        <div style={{ display: "flex", justifyContent: "space-between", marginBottom: 20 }}>
          <div>
            <strong>ÏóÖÏ≤¥Î™Ö</strong>
            <p>{company || "ÏóÖÏ≤¥Î™Ö ÎØ∏ÏûÖÎ†•"}</p>
          </div>
          <div style={{ textAlign: "right" }}>
            <strong>Î∞úÌñâÍ∏∞Í¥Ä</strong>
            <p>Í¥ÄÏÑ∏Î≤ïÏù∏ ÌïúÏòÅ</p>
          </div>
        </div>

        {importItems.length > 0 && renderTable("ÏàòÏûÖÌÜµÍ¥Ä ÏàòÏàòÎ£å", importItems)}
        {exportItems.length > 0 && renderTable("ÏàòÏ∂úÌÜµÍ¥Ä ÏàòÏàòÎ£å", exportItems)}

        <p style={{ marginTop: 30, fontSize: 15, textAlign: "right", fontWeight: 600 }}>‚Äª V.A.T Î≥ÑÎèÑ</p>

        <div style={{ display: "flex", justifyContent: "space-between", fontSize: 14, marginTop: 60 }}>
          <div>
            <p><strong>ÏûÖÍ∏àÍ≥ÑÏ¢å</strong>: Ïã†ÌïúÏùÄÌñâ 140-015-193246</p>
            <p><strong>ÏòàÍ∏àÏ£º</strong>: Í¥ÄÏÑ∏Î≤ïÏù∏ ÌïúÏòÅ Ïù∏Ï≤úÏßÄÏÇ¨</p>
          </div>
          <div style={{ textAlign: "right", color: "#666" }}>
            <p><strong>Í≤¨Ï†Å Ïú†Ìö®Í∏∞Í∞Ñ</strong>: {new Date(today.getTime() + 15 * 86400000).toLocaleDateString("ko-KR")}</p>
            <p>Ïù∏Ï≤úÍ¥ëÏó≠Ïãú ÏÑúÍµ¨ Ïù¥Ïùå4Î°ú6, KRÎ≤ïÏ°∞ÌÉÄÏõå 915Ìò∏</p>
            <p>TEL: 032-713-4897 / FAX: 032-713-4898</p>
          </div>
        </div>
      </div>

      <div style={{ marginTop: 40, display: "flex", justifyContent: "center", gap: 20 }}>
        <button onClick={() => navigate("/")} style={{ backgroundColor: "#aaa", border: "none", padding: "10px 30px", borderRadius: 6, color: "#fff", fontWeight: 600 }}>
          Îã§ÏãúÌïòÍ∏∞
        </button>
        <button onClick={downloadPDF} style={{ backgroundColor: "#111", border: "none", padding: "10px 30px", borderRadius: 6, color: "#fff", fontWeight: 700 }}>
          üì• PDF Îã§Ïö¥Î°úÎìú
        </button>
      </div>
    </>
  );
}
